import logo from './logo.svg';
import './App.css';
const user = {
  name: 'Hedy Lamarr',
  imageUrl: 'https://i.imgur.com/yXOvdOSs.jpg',
  imageSize: 90,
};

function App() {  

  function handleClick() {
    alert('you clicked me');
  }

  return (
    <button onClick={handleClick}>
      Click me
    </button>

  );
}
function MyButton() {
  return (
    <button>I'm a button</button>
  );
}

export default App;
